import React from 'react';
import ReactDOM from 'react-dom/client';
import {createBrowserRouter, Link, RouterProvider, useNavigate} from "react-router-dom";
import './index.css';
import reportWebVitals from './reportWebVitals';



function WelcomePage() {
    const navigate = useNavigate();

    const routeChange = () => navigate("/questions")
   // return <button onClick={routeChange} >HELLO ON THE WELCOME PAGE</button>
    return  <>
                <Link to={"/questions"}>
                    <button>Click On Me</button>
                </Link>
            </>
}

function MainPage() {
    return <div>WELLCOME TO THE MAIN PAGE</div>
}

function IdPage() {
    return null;
}

const router = createBrowserRouter([
    {
        path:"/",
        element: <WelcomePage/>,
        children: [],
    },
    {
        path: "/questions",
        element: <MainPage />,
        children:[
            {
                path: "/questions/:id",
                element: <IdPage/>,
            }
        ],
    }
]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <RouterProvider router = {router}/>
  </React.StrictMode>
);

